class Solution {
public:
    vector<int> productExceptSelf(vector<int>& nums) {

        vector<int> result;
        unsigned int size=nums.size();
        int mul=1;
        string blank;
        cout << size << endl;
        for(unsigned int i = 0; i< size; i++)
        {
            mul*=nums[i];
            cout << mul << "\n";
            cin >> blank;
        }

        cout << mul << "\n";

        for(unsigned int i=0; i<size; i++) {
            int data=1;

            for(unsigned int j=0; j<size; j++) {
                if(j==i) { continue; }
                else { data *= nums[j];}
            }
            result.push_back(data);
        }
        return result;
    }
};

